  'Dialogue: 0,0:18:37.67,0:18:48.43,Default,Reward,0000,0000,0000,,{\\bord2\\shad0\\blur0.4\\b1\\an3\\fs25\\fscx69\\c&H171E18&\\frz359.7\\3c&H6F8495&\\pos(532.666,300.667)}Roughly 5 Million Sols Reward',
  'Dialogue: 1,0:18:38.13,0:18:40.69,Default,Ota,0000,0000,0000,,I\'m going to go fertilize the king trumpet.',
  'Dialogue: 1,0:18:43.21,0:18:46.57,Default,Milo,0000,0000,0000,,Like you say, he doesn\'t look like a bad guy.',
  'Dialogue: 0,0:18:49.61,0:18:52.27,Default,Inoshige,0000,0000,0000,,As a civil servant, \\NI shouldn\'t be saying this,',
  'Dialogue: 0,0:18:52.77,0:18:58.21,Default,Inoshige,0000,0000,0000,,but there\'s hardly anyone who believes \\Nhe\'s a bad guy like the wanted poster says.',
  'Dialogue: 0,0:18:59.17,0:19:02.34,Default,Inoshige,0000,0000,0000,,Apparently, this Panda \\Nguy was a famous doctor.',
  'Dialogue: 0,0:19:02.34,0:19:06.26,Default,Inoshige,0000,0000,0000,,Rumor has it he went against the \\Ngovernment and treated the sick for free,',
  'Dialogue: 0,0:19:06.54,0:19:09.36,Default,Inoshige,0000,0000,0000,,and this is what it got him.',
  'Dialogue: 0,0:19:11.92,0:19:13.02,Default,Inoshige,0000,0000,0000,,There.',
  'Dialogue: 0,0:19:13.78,0:19:18.91,Default,Inoshige,0000,0000,0000,,And Akaboshi, right next to him, might \\Nlook like the kind of guy who\'d eat people,',
  'Dialogue: 0,0:19:20.63,0:19:24.43,Default,Inoshige,0000,0000,0000,,but I don\'t think he\'s that bad a guy, either.',
  'Dialogue: 0,0:19:25.01,0:19:28.03,Default,Inoshige,0000,0000,0000,,He\'s just a little flashy in the\\N way he goes about things.',
  'Dialogue: 0,0:19:38.07,0:19:40.57,Default,Sign,0000,0000,0000,,{\\bord3\\shad0\\blur0.75\\p1\\fscx70\\fscy20\\fax0.07\\frz346.5\\frx0\\fry16\\c&H323343&\\3c&H323343&\\pos(255.333,220)}m 1 0 l 100 0 100 100 0 100',
